import Test from './functuinscrip/test.js'
function App() {
  return (
    <Router>
      <div className="contant">
      <Navbar>
      </Navbar>
      <Routes>
        <Route path='/' element={<Home></Home>}></Route>
        <Route path='/About' element={<About></About>}></Route>
